import { Link } from "react-router-dom";

export const ProjectCard = ({ title, description, imgUrl, linkTo}) => {
  return (
    <Col xs={12} md={4}>
      <div className="proj-imgbx">
        <img src={imgUrl} />
        <div className="proj-txtx">
          <h4>{title}</h4>
          <span>{description}</span>
          <Link to={linkTo} target="_blank">view</Link>
        </div>
      </div>
    </Col>
  )
}
